import { useNavigate } from "react-router-dom";

export default function Logout(props) {
  const user = props.currentUser;
  console.log(user);
  let navigate = useNavigate();
  if (user) {
    localStorage.removeItem("userData");
    navigate("/");
    //window.location.reload();
  }
}
